import React, { Component } from 'react';


//import WelcomePage from './WelcomePage';


//import './desktop.css';

class ReportContainer extends Component {
	constructor(props, context) { 
     	super(props, context); 
 //    	this.props.componente = "Login"; 	   
	 } 		
  	render() {
  		console.log(this.props.table);
  // 		let componentList = {
		// 	WelcomePage   : WelcomePage,
		// 	Reciclators   : Reciclators,
		// 	Costumers     : Costumers,
		// 	Purchases     : Purchases,
		// 	ControlPanel  : ControlPanel,
		// 	FormPurchases : FormPurchases,
		// 	DocumentTypes : DocumentTypes,
		// 	PurchaseTypes : PurchaseTypes,
		// 	Users 		  : Users,
		// 	FormDataGrid  : FormDataGrid,
		// 	Reports  	  : Reports						  
		// } 
		
  // 		let ChildComponent = componentList[this.props.componente];		
  	  	return (		  
  	  		<div id="BodyInformes_InformesRubik" style="height: calc(100% - 70px);">
    			<div id="tbarInformes_InformesRubik_Infotipri" className="tbarInformes_">
    			    <div id="PanelScrollY_InformesRubik_Infotipri" style="width: calc(100% + 210px);">
    			        <div id="PanelCampos_InformesRubik_Infotipri" className="PanelCampos_" style="width: 210px;">
    			            <div id="form_content_field_PanelCampos_InformesRubik_Infotipri_desde" materialdesign="false" className="form_content_field" style="width:200px; min-height:30px; display:block">
    			                <div id="form_label_PanelCampos_InformesRubik_Infotipri_desde" className="form_label" style="width:auto;">Fecha inicio</div>
    			                <div id="form_field_PanelCampos_InformesRubik_Infotipri_desde" className="form_field" style="width:auto;">
    			                    <input type="text" name="desde" id="form_PanelCampos_InformesRubik_Infotipri_desde" value="2019-06-12" style="width:100%;" data-value="2019-06-12" data-required="true" data-style="none" data-label="Fecha inicio" fieldname="desde" /> 
    			                 </div>
    			            </div>
    			            <div data-role="div-empty"></div>
    			            <div id="form_content_field_PanelCampos_InformesRubik_Infotipri_hasta" materialdesign="false" className="form_content_field" style="width:200px; min-height:30px; display:block">
    			                <div id="form_label_PanelCampos_InformesRubik_Infotipri_hasta" className="form_label" style="width:auto;">Fecha fin</div>
    			                <div id="form_field_PanelCampos_InformesRubik_Infotipri_hasta" className="form_field" style="width:auto;">
    			                    <input type="text" name="hasta" id="form_PanelCampos_InformesRubik_Infotipri_hasta" value="2019-07-12" style="width:100%;" data-value="2019-07-12" data-required="true" data-style="none" data-label="Fecha fin" fieldname="hasta" />
    			                </div>    			            
    			            </div>
    			            <div data-role="div-empty"></div>
    			        </div>
    			        <div id="PanelBotones_InformesRubik_Infotipri" className="PanelBotones_">
    			            <div id="win-btn-1" className="win-btn" style="width:65px;" data-role="win-btn" data-state="enable"> <i className="material-icons" style="color:#FFF; font-size:24px; width:100%;top:10px">flash_on</i>
    			                <button className="save" os="windows">Generar Informe</button>
    			            </div>
    			            <div data-role="div-empty"></div>
    			            <div id="win-btn-2" className="win-btn" style="width:65px;" data-role="win-btn" data-state="enable"> <i className="material-icons" style="color:#FFF; font-size:24px; width:100%;top:10px">arrow_downward</i>
    			                <button className="save" os="windows">Generar Excel</button>
    			            </div>
    			            <div data-role="div-empty"></div>
    			            <div id="win-btn-3" className="win-btn" style="width:65px;" data-role="win-btn" data-state="enable"> <i className="material-icons" style="color:#FFF; font-size:24px; width:100%;top:10px">picture_as_pdf</i>
    			                <button className="save" os="windows">Generar PDF</button>
    			            </div>
    			            <div data-role="div-empty"></div>
    			        </div>
    			    </div>
    			</div>
    			<div id="PanelInforme_InformesRubik_Infotipri" className="PanelInforme_" style="height: calc(100% - 91px);">
    			    <div id="InformeFile_InformesRubik_Infotipri" className="InformeFile_" tamano="letter" orientacion="V" style="max-width: 812px; min-width: 812px;"></div>
    			</div>
			</div> 	  		    
	    );
  	}
}

export default ReportContainer
